import * as React from 'react'
import { useState } from 'react';

import Diary from './components/Diary';
import Explore from './components/Explore';
import ExploreArticle from './components/ExploreArticle';
import Profile from './components/Profile';
import Statistics from './components/Statistics';
import HomePage from './components/HomePage';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import 'react-native-gesture-handler';

import * as Font from 'expo-font';

const Stack = createStackNavigator();

const App = () => {

  return (
    <NavigationContainer>

      <Stack.Navigator initialRouteName="HomeActivity"
        screenOptions={{ headerShown: false }} initialRouteName="Home">
 <Stack.Screen
          name="ExploreArticle"
          component={ExploreArticle}
          options={{
            title: 'Utforska',
            headerTintColor: '#fff',
            headerStyle: {
              backgroundColor: '#5A673E',
            },
          }}
        />
        <Stack.Screen
          name="HomePage"
          component={HomePage} />

        <Stack.Screen
          name="Explore"
          component={Explore}
          options={{
            title: 'Utforska',
            headerTintColor: '#fff',
            headerStyle: {
              backgroundColor: '#5A673E',
            },
          }}
        />


        <Stack.Screen
          name='Diary'
          component={Diary}
          options={{
            title: 'Dagbok',
            headerTintColor: '#fff',
            headerStyle: {
              backgroundColor: '#BD614E',
            },
          }}
        />


        <Stack.Screen
          name="Statistics"
          component={Statistics}
          options={{
            title: 'Statestik',
            headerTintColor: '#fff',
            headerStyle: {
              backgroundColor: '#C497A4',
            },
          }} />

        <Stack.Screen
          name="Profile"
          component={Profile}
          options={{
            title: 'Profil',
            headerTintColor: '#fff',
            headerStyle: {
              backgroundColor: '#CE7937',
            },
          }} />
      </Stack.Navigator>
    </NavigationContainer>

  )
}

export default App;
